  const isDarkMode =
  window.matchMedia &&
  window.matchMedia("(prefers-color-scheme: dark)").matches;
let mouseX = 0;
let mouseY = 0;
let pause = false;
let menu = document.createElement("button");
menu.innerText = "Pause";
menu.style.borderRadius = "5px";
menu.style.boxShadow = "-2px 2px rgba(0, 0, 0, 0.5)";
menu.style.display = "none";
menu.style.position = "absolute";
menu.style.zIndex = "9999";
if (isDarkMode) {
  document.body.style.backgroundColor = "#242222";
  document.body.style.color = "#FFFFFF";
  menu.style.backgroundColor = "#1C1A1A";
  menu.style.color = "#FFFFFF";
} else {
  menu.style.backgroundColor = "#FFFFFF";
  menu.style.color = "#000000";
}
document.body.appendChild(menu);

document.addEventListener("mousemove", function (e) {
  mouseX = e.clientX;
  mouseY = e.clientY - 20;
});
document.addEventListener("contextmenu", function (e) {
  e.preventDefault();
  menu.style.display = "block";
  menu.style.transform = "translate3d(" + mouseX + "px, " + mouseY + "px, 0px)";
});
menu.addEventListener("click", function (e) {
  if (pause) {
    pause = false;
    menu.innerText = "Pause";
  } else {
    pause = true;
    menu.innerText = "Unpause";
  }
  menu.style.display = "none";
});
document.addEventListener("click", function (e) {
  window.setTimeout(function () {
    menu.style.display = "none";
  }, 10);
});
const Base64Img = {
  Original:
    "",
  Black:
    "",
  Ghost:
    "",
  Tabby:
    "",
  Ice:
    "",
  Pink:
    ""

  };
const Base64ImgOffsets = {
  idle: "0px 0px",
  lick: "-20px 0px",
  itch1: "-40px 0px",
  itch2: "-60px 0px",
  yawn: "-80px 0px",
  sleep1: "-100px 0px",
  sleep2: "-120px 0px",
  alert: "-140px 0px",
  Srun1: "0px -20px",
  Srun2: "-20px -20px",
  SErun1: "-40px -20px",
  SErun2: "-60px -20px",
  Erun1: "-80px -20px",
  Erun2: "-100px -20px",
  NErun1: "-120px -20px",
  NErun2: "-140px -20px",
  Nrun1: "0px -40px",
  Nrun2: "-20px -40px",
  NWrun1: "-40px -40px",
  NWrun2: "-60px -40px",
  Wrun1: "-80px -40px",
  Wrun2: "-100px -40px",
  SWrun1: "-120px -40px",
  SWrun2: "-140px -40px",
  Sscratch1: "0px -60px",
  Sscratch2: "-20px -60px",
  Escratch1: "-40px -60px",
  Escratch2: "-60px -60px",
  Nscratch1: "-80px -60px",
  Nscratch2: "-100px -60px",
  Wscratch1: "-120px -60px",
  Wscratch2: "-140px -60px",
};

class Neko {
  constructor(x, y, speed, type, custom) {
    this.type = type || "Original";
    this.custom = custom || false;
    this.div = document.createElement("div");
    document.body.appendChild(this.div);
    this.div.style.willChange = `transform`;
    this.div.style.imageRendering = `pixelated`;
    this.div.style.width = "20px";
    this.div.style.height = "20px";
    this.div.style.padding="0px";
    if (this.custom) {
      this.div.style.backgroundImage = `url('${this.custom}')`;
    } else {
      this.div.style.backgroundImage = `url('data:image/png;base64,${Base64Img[this.type]}')`;
    }
    this.div.style.position = "absolute";
    this.div.style.zIndex = "9998";
    this.div.style.backgroundPosition = Base64ImgOffsets.idle;
    this.div.style.pointerEvents = "none";
    this.speed = speed || 10;
    if(this.speed<5){
      this.speed=5;
    }
    else if(this.speed>45){
      this.speed=45;
    };
    this.x = x || 100;
    this.y = y || 100;
    this.dist = 0;
    this.angle = 0;
    this.NormAngle = 0;
    this.dy = 0;
    this.dx = 0;
    this.appearance = "idle";
    this.idleTime = 0;
    this.moveNum = 0;
    this.frame = 0;

    this.calculate = () => {
      this.dx = mouseX - this.x;
      this.dy = mouseY - this.y;
      this.dist = Math.sqrt(this.dx ** 2 + this.dy ** 2);
      this.angle = Math.atan2(this.dy, this.dx);
      this.angle = this.angle * (180 / Math.PI);
      if (this.angle < 0) {
        this.NormAngle = this.angle + 360;
      } else {
        this.NormAngle = this.angle;
      }
    };
    this.move = () => {
      this.x += (this.dx / this.dist) * this.speed;
      this.y += (this.dy / this.dist) * this.speed;
      this.div.style.transform =
        "translate3d(" + (this.x - 10) + "px, " + (this.y - 10) + "px, 0px)";
    };
    this.FindDirection = (type) => {
      this.calculate();
      if (type == 4) {
        if (this.NormAngle > 315 || this.NormAngle <= 45) {return "E";}
        else if (this.NormAngle > 45 && this.NormAngle <= 135){ return "S";} // 90 = North
        else if (this.NormAngle > 135 && this.NormAngle <= 225) {return "W";} // 180 = West
        else{
          return "N";
        } // 270 = South

        }
       else {
        if (this.NormAngle > 337.5 || this.NormAngle <= 22.5) {
          return "E";
        } else if (this.NormAngle > 22.5 && this.NormAngle <= 67.5) {
          return "SE";
        } else if (this.NormAngle > 67.5 && this.NormAngle <= 112.5) {
          return "S";
        } else if (this.NormAngle > 112.5 && this.NormAngle <= 157.5) {
          return "SW";
        } else if (this.NormAngle > 157.5 && this.NormAngle <= 202.5) {
          return "W";
        } else if (this.NormAngle > 202.5 && this.NormAngle <= 247.5) {
          return "NW";
        } else if (this.NormAngle > 247.5 && this.NormAngle <= 292.5) {
          return "N";
        } else {
          return "NE";
        }
      }
    };
    this.SetAppearance = () => {
      this.div.style.backgroundPosition = Base64ImgOffsets[this.appearance];
    };
    this.UpdateAppearance = () => {
      this.frame++;
      this.calculate();
      if (this.dist < 50 || pause) {
        this.idleTime++;
        if (this.frame % Math.round(50/this.speed) == 0) {
          if (this.appearance.includes("run")) {
            this.moveNum = 0;
          }
          this.moveNum++;
          if (this.idleTime > 25 * 60) {
            this.appearance = "sleep" + ((this.moveNum % 2) + 1).toString();
          } else if (this.idleTime > 20 * 60 && this.idleTime < 23 * 60) {
            this.appearance = "yawn";
          } else if (this.idleTime > 15 * 60 && this.idleTime < 19 * 60) {
            this.appearance = "itch" + ((this.moveNum % 2) + 1).toString();
          } else if (this.idleTime > 5 * 60 && this.idleTime < 14 * 60) {
            this.appearance =
              this.FindDirection(4) +
              "scratch" +
              ((this.moveNum % 2) + 1).toString();
              console.log(this.appearance);
          } else {
            this.appearance = "idle";
          }
        }
      } else {
        if (this.frame % Math.round(50/this.speed) == 0) {
          if (this.appearance == "alert") {
            this.moveNum = 0;
            this.idleTime = 0;
            this.appearance = this.FindDirection(8) + "run";
          } else if (!this.appearance.includes("run") && this.idleTime > 59) {
            this.idleTime = 0;
            this.moveNum = 0;
            this.appearance = "alert";
          } else {
            this.moveNum++;
            this.appearance =
              this.FindDirection(8) +
              "run" +
              ((this.moveNum % 2) + 1).toString();
            this.move();
          }
        }
      }
      this.SetAppearance();
      window.requestAnimationFrame(this.UpdateAppearance);
    };
    this.UpdateAppearance();
  }
}

